import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
export default function Header(props) {
  // props defines what properties are importing in this
  return (
    <nav className="navbar navbar-expand-lg bg-light">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">
          ToDo-List
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link className="nav-link active" aria-current="page" to="/">
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about">
                {props.change}
              </Link>
            </li>
          </ul>
          {props.searchbar ? (
            <form className="d-flex" role="search">
              <input
                className="form-control me-2"
                type="search"
                placeholder="Search"
                aria-label="Search"
              />
              <button className="btn btn-outline-success" type="submit">
                Search
              </button>
            </form>
          ) : (
            "nosearchbar"
          )}
        </div>
      </div>
    </nav>
  );
}
Header.defaultProps = {
  title: "your title", // if user want to change the title and not give title then bydefault title
};
Header.propType = {
  title: PropTypes.string, // just to tell what should be the type of prop.
};
